import { createTheme, ThemeProvider } from "@mui/material/styles";
import useMediaQuery from "@mui/material/useMediaQuery";
import CssBaseline from "@mui/material/CssBaseline";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Link from "@mui/material/Link";
import Header from "../../Components/Header/Header";
import imge from "../../Asserts/Images/signin.png";
import Navbar from "../../Components/Navbar/Navbar.js";
import { height } from "@mui/system";
import React, { useEffect, useState } from "react";
import { CartState } from "../../context/Context";
import Navigator from "../../Components/Navigator/Navigator";
import Content from "../../Components/Content/Content";
import product_cart from "../../Components/data/product_data";

import "./Discover.css";

let theme = createTheme({
  mixins: {
    toolbar: {
      minHeight: 80,
    },
  },
});

const drawerWidth = 256;
/*--------------------------------------------------------*/
export default function Discover() {
  const [ages, setages] = useState([
    { id: 1, checked: false, label: "0-5" },
    { id: 2, checked: false, label: "5-10" },
    { id: 3, checked: false, label: "10-15" },
    { id: 4, checked: false, label: "+15" },
  ]);

  /****************************************************/
  const [list, setList] = useState(product_cart);
  const [resultsFound, setResultsFound] = useState(true);
  /****************************************************/
  const handleChangeChecked = (id) => {
    const agesStateList = ages;
    /****************************************************/
    const changeCheckedages = agesStateList.map((item) =>
      item.id === id ? { ...item, checked: !item.checked } : item
    );
    setages(changeCheckedages);
  };
  /****************************************************/

  const agesChecked = ages
    .filter((item) => item.checked)
    .map((item) => item.label.toLowerCase());

  /****************************************************/
  const applyFilters = () => {
    let updatedList = product_cart;

    if (agesChecked.length) {
      console.log("agesChecked------", agesChecked);
      updatedList = updatedList.filter((item) => {
        //les ages dans la liste
        const ageRange = agesChecked
          .split("-")
          .map((age) => parseInt(age.trim()));
        console.log("ageRange------", ageRange);
        // Check if item.age is not a string and return false if so
        if (typeof item.age == "string") {
          return false;
        }
        // Split the age string at the hyphen and convert each age to an integer
        const [minAge, maxAge] = ageRange;
        //console.log("age range////////////", ageRange);
        // Destructure the age range into minAge and maxAge variables
        const ageChecked = agesChecked.map((age) => parseInt(age.trim()));
        // Convert the age range selected by the user to an array of integers
        return ageChecked.some((age) => age >= minAge && age <= maxAge);
        // Check if any age in ageChecked is within the range of ages in ageRange
      });
    }
    console.log("updared list***********************", updatedList);
    setList(updatedList);

    !updatedList.length ? setResultsFound(false) : setResultsFound(true);
  };

  /****************************************************/

  useEffect(() => {
    applyFilters();
  }, [ages]);

  /*--------------------------------------------------------*/
  const [mobileOpen, setMobileOpen] = React.useState(false);
  const isSmUp = useMediaQuery(theme.breakpoints.up("sm"));

  const handleDrawerToggle = () => {
    console.log(mobileOpen);
    setMobileOpen(!mobileOpen);
    console.log(mobileOpen);
  };
  return (
    <ThemeProvider theme={theme}>
      <Box
        className="Boxii"
        sx={{
          display: "flex",
          backgroundImage: `url(${imge})`,
          backgroundRepeat: "no-repeat",
          backgroundSize: "cover",
          backgroundAttachment: "fixed",
        }}
      >
        <Box
          component="nav"
          sx={{ width: { sm: drawerWidth }, flexShrink: { sm: 0 } }}
        >
          {(isSmUp || !mobileOpen) && (
            <Navigator
              variant="temporary"
              open={mobileOpen}
              onClose={handleDrawerToggle}
              ages={ages}
              changeChecked={handleChangeChecked}
            />
          )}
        </Box>

        <Box
          className="red"
          sx={{
            display: "flex",
            justifyContent: "center",
            flexDirection: "column",
            width: "100%", // change to 100% width
            maxWidth: "150vh", // add max-width for larger screens
            marginTop: "2vh",
            marginLeft: "8vh",
            marginRight: "4vh",
          }}
        >
          <Header onDrawerToggle={handleDrawerToggle} />=
          <div
            style={{
              overflow: "auto",
              display: "flex",
              minHeight: "80vh",
              marginTop: "30px",
              backgroundColor: "#f3ecb059",
              boxShadow: "0 8px 32px rgba(31,28,135,0.37) ",
              borderRadius: "10px",
            }}
          >
            {<Content list={list} />}
          </div>
        </Box>
      </Box>
    </ThemeProvider>
  );
}
